import'./Navbar.css'
class Navbar extends Component {
    render (){
        return (
            <div className="nav-color">

                <ul className="nav">
                    <a href="#"><li>Portfolio</li></a>
                    <a href="#"><li>About</li></a>
                    <a href="#"><li>Home</li></a>
                </ul>
            </div>

        )
    }
}
export default Navbar
